// Filename - components/array.js

// Javascript object named array 
// with 3 key-values
const array = [
	{
		id: "1",
		Name: "Shivansh",
		Age: "23",
	},
	{
		id: "2",
		Name: "Simran",
		Age: "22",
	},
	{
		id: "3",
		Name: "Aakash",
		Age: "23",
	},
];


const navs = [
    {id: 1, name: 'Home', path: '/', element: <Home/>},
    {id: 2, name: 'About', path: '/about', element: <About/>},
    {id: 3, name: 'Clock', path: '/clock', element: <Clock/>},
];

export default array;
